/*
The footer for the search/results page.
*/
import React from 'react';
import footer from './img/footer.png';
  
const Footer = () => (
  
  <footer className="footer">
    
    {/* {logo} */}
    

   
    <img src={footer}  alt=""/>{" "}
   

  </footer>
);
  
export default Footer;
